import React, {Component} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import '../styles/site.css';

export default class Home extends Component {

  constructor(props) {
    super(props);

    this.state= {
      home_title:'',
      home_description:''
    }
  }

  componentDidMount() {
    axios.get("http://localhost:4000/home")
    .then(res => {
      this.setState({
        home_title:res.data.home_title,
        home_description:res.data.home_description
      })
      console.log(res.data)
    })
    .catch(function (err) {
      console.log(err);
    })
  }

  render() {
    return (
      <div id='home' className='section'>
      <h2> Home </h2>
      <p>{this.state.home_title}</p>
      <p>{this.state.home_description}</p>
      </div>
    )
  }
}
